#!/bin/bash

# Store networks in array if provided, otherwise leave empty
networks=("$@")
NETWORKS_URL="${NETWORKS_URL:-https://raw.githubusercontent.com/rhinestonewtf/constants/refs/heads/main/networks.txt}"
echo "NETWORKS_URL: $NETWORKS_URL"

while IFS='=' read -r network url; do
    # Skip empty lines and comments
    [[ -z $network || $network == \#* ]] && continue
    # Skip if networks specified and current one not included
    [[ ${#networks[@]} -gt 0 && ! " ${networks[@]} " =~ " ${network} " ]] && continue

    expanded_url=$(echo "$url" | envsubst)

    # Check required addresses
    # Safe Singleton Factory
    code=$(cast code 0x914d7Fec6aaC8cd542e72Bca78B30650d45643d7 --rpc-url "$expanded_url")
    if [ "$code" == "0x" ]; then
        printf '%s\n' "Error: Safe Singleton Factory not deployed" >&2
        exit 1
    fi

    # Deploy Dependencies
    printf 'Checking Dependencies...\n'
    # Safe Singleton 
    code=$(cast code 0x29fcB43b46531BcA003ddC8FCB67FFE91900C762 --rpc-url "$expanded_url")
    if [ "$code" == "0x" ]; then
        cast send 0x914d7Fec6aaC8cd542e72Bca78B30650d45643d7  --rpc-url "$expanded_url" --private-key "$PRIVATE_KEY"
    fi

    # Safe Proxy Factory
    code=$(cast code 0x4e1DCf7AD4e460CfD30791CCC4F9c8a4f820ec67 --rpc-url "$expanded_url")
    if [ "$code" == "0x" ]; then
        cast send 0x914d7Fec6aaC8cd542e72Bca78B30650d45643d7  --rpc-url "$expanded_url" --private-key "$PRIVATE_KEY"
    fi

    # Compatibility Fallback Handler
    code=$(cast code 0xfd0732Dc9E303f09fCEf3a7388Ad10A83459Ec99 --rpc-url "$expanded_url")
    if [ "$code" == "0x" ]; then
        cast send 0x914d7Fec6aaC8cd542e72Bca78B30650d45643d7  --rpc-url "$expanded_url" --private-key "$PRIVATE_KEY"
    fi

    # MultiSend
    code=$(cast code 0x38869bf66a61cF6bDB996A6aE40D5853Fd43B526 --rpc-url "$expanded_url")
    if [ "$code" == "0x" ]; then
        cast send 0x914d7Fec6aaC8cd542e72Bca78B30650d45643d7  --rpc-url "$expanded_url" --private-key "$PRIVATE_KEY"
    fi

    # MultiSendCallOnly 
    code=$(cast code 0x40A2aCCbd92BCA938b02010E17A5b8929b49130D --rpc-url "$expanded_url")
    if [ "$code" == "0x" ]; then
        cast send 0x4e59b44847b379578588920cA78FbF26c0B4956C  --rpc-url "$expanded_url" --private-key "$PRIVATE_KEY"
    fi

    printf "All dependencies deployed\n"


    # Deploy Contracts 
    # Registry
    code=$(cast code 0x000000000069E2a187AEFFb852bF3cCdC95151B2 --rpc-url "$expanded_url")
    if [ "$code" == "0x" ]; then
        cast send 0x914d7Fec6aaC8cd542e72Bca78B30650d45643d7  --rpc-url "$expanded_url" --private-key "$PRIVATE_KEY"
    fi
    printf '\e]8;;https://contractscan.xyz/contract/0x000000000069E2a187AEFFb852bF3cCdC95151B2\e\\Registry successfully deployed\e]8;;\e\\\n'

    # Schema Validator Impl
    code=$(cast code 0x6a1154d99087f6bdb183cfc8cf7b6e67c641d9e3 --rpc-url "$expanded_url")
    if [ "$code" == "0x" ]; then
        cast send 0x914d7Fec6aaC8cd542e72Bca78B30650d45643d7  --rpc-url "$expanded_url" --private-key "$PRIVATE_KEY"
    fi
    printf '\e]8;;https://contractscan.xyz/contract/0x6a1154d99087f6bdb183cfc8cf7b6e67c641d9e3\e\\Schema Validator successfully deployed\e]8;;\e\\\n'

    # Schema Validator Proxy
    code=$(cast code 0x86430e19d7d204807bbb8cda997bb57b7ee785dd --rpc-url "$expanded_url")
    if [ "$code" == "0x" ]; then
        cast send 0x914d7Fec6aaC8cd542e72Bca78B30650d45643d7  --rpc-url "$expanded_url" --private-key "$PRIVATE_KEY"
    fi
    printf '\e]8;;https://contractscan.xyz/contract/0x86430e19d7d204807bbb8cda997bb57b7ee785dd\e\\Schema Validator Proxy successfully deployed\e]8;;\e\\\n'

    # Resolver Impl
    code=$(cast code 0x80227007ea32188620ce93ed8702807dd7e5af61 --rpc-url "$expanded_url")
    if [ "$code" == "0x" ]; then
        cast send 0x914d7Fec6aaC8cd542e72Bca78B30650d45643d7  --rpc-url "$expanded_url" --private-key "$PRIVATE_KEY"
    fi
    printf '\e]8;;https://contractscan.xyz/contract/0x80227007ea32188620ce93ed8702807dd7e5af61\e\\Resolver successfully deployed\e]8;;\e\\\n'

    # Resolver Proxy
    code=$(cast code 0xf0f468571e764664c93308504642af941d9f77f1 --rpc-url "$expanded_url")
    if [ "$code" == "0x" ]; then
        cast send 0x914d7Fec6aaC8cd542e72Bca78B30650d45643d7  --rpc-url "$expanded_url" --private-key "$PRIVATE_KEY"
    fi
    printf '\e]8;;https://contractscan.xyz/contract/0xf0f468571e764664c93308504642af941d9f77f1\e\\Resolver Proxy successfully deployed\e]8;;\e\\\n'

    # RS Attester 
    code=$(cast code 0x000000333034e9f539ce08819e12c1b8cb29084d --rpc-url "$expanded_url")
    if [ "$code" == "0x" ]; then
        cast send 0x4e1DCf7AD4e460CfD30791CCC4F9c8a4f820ec67  --rpc-url "$expanded_url" --private-key "$PRIVATE_KEY"
    fi
    printf '\e]8;;https://contractscan.xyz/contract/0x000000333034e9f539ce08819e12c1b8cb29084d\e\\Rhinestone Attester successfully deployed\e]8;;\e\\\n'

    # Staff Safe 
    code=$(cast code 0x99c6012a4c2642a23685b060b670f888d6f9fe66 --rpc-url "$expanded_url")
    if [ "$code" == "0x" ]; then
        cast send 0x4e1DCf7AD4e460CfD30791CCC4F9c8a4f820ec67  --rpc-url "$expanded_url" --private-key "$PRIVATE_KEY"
    fi
    printf '\e]8;;https://contractscan.xyz/contract/0x99c6012a4c2642a23685b060b670f888d6f9fe66\e\\Staff Safe successfully deployed\e]8;;\e\\\n'

done < <(curl -s "$NETWORKS_URL")
